import React, { Component } from "react";
import "../css/Carousel.css";
import { Carousel } from "antd";

const Carousels = (props) => {
  return (
    <Carousel>
      <div>
        <h3>1</h3>
      </div>
      <div>
        <h3>2</h3>
      </div>
      <div>
        <h3>3</h3>
      </div>
      <div>
        <h3>4</h3>
      </div>
    </Carousel>
  );
};

export default Carousels;
